import Articletitle from 'components/common/Articletitle';
import React from 'react';
import styled from 'styled-components';
import { HomeTopbannerDummydata } from 'utils/mockData';
import TopBanner from '../../components/common/TopBanner';
import ChipScroll from './ChipScroll';

function HomePage() {
	return (
		<ComponentsWrapper>
			<TopBanner data={HomeTopbannerDummydata} />
			<section className="section">
				<div className="box-section-wrapper">
					<Articletitle title="나에게 필요한 커리어 인사이트" />
					<ChipScroll />
				</div>
			</section>

			<BnnaerCreatApplication>
				<div className="banner-creatapplication-container">
					<div className="banner-creatapplication-content">
						즐겨보는 <span>크리에이터의</span> 글도 추천하고 싶다면?
					</div>
					<div className="banner-creatapplication-imgwrapper">
						<img
							src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fimage.wanted.co.kr%2Fuserweb%2Fcareerhome%2Fcreator-application.png&amp;w=121&amp;q=75"
							alt="크리에이터 추천하기"
							loading="lazy"
						/>
					</div>
				</div>
			</BnnaerCreatApplication>
		</ComponentsWrapper>
	);
}

const BnnaerCreatApplication = styled.div`
	display: flex;
	height: 110px;
	background-color: #36f;
	.banner-creatapplication-container {
		max-width: 1060px;
		width: 87.72%;
		margin: 0 auto;
		flex-direction: row;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: center;
		justify-content: flex-start;
	}
	.banner-creatapplication-content {
		font-size: 24px;
		color: #fff;
		font-weight: 500;
		line-height: 35px;
		letter-spacing: -0.2px;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: row;
		box-sizing: border-box;
		> span {
			color: #a9ecf0;
		}
	}
	.banner-creatapplication-imgwrapper {
		flex-grow: 1;
	}
	.Grid_Grid__align-self_auto__sjisA {
		-ms-flex-item-align: auto;
		align-self: auto;
	}
	.Grid_Grid__wrap_nowrap__4r_cp {
		-ms-flex-wrap: nowrap;
		flex-wrap: nowrap;
	}
	.Grid_Grid__align-items_flex-start__PA0JE {
		-ms-flex-align: start;
		align-items: flex-start;
	}
	.Grid_Grid__justify_flex-start__auIsx {
		-ms-flex-pack: start;
		justify-content: flex-start;
	}
	.Grid_Grid__direction_row__j_m9q {
		-ms-flex-direction: row;
		flex-direction: row;
	}
	.Grid_Grid__item__FUkSS {
		-webkit-box-sizing: border-box;
		box-sizing: border-box;
		margin: 0;
	}
`;

const ComponentsWrapper = styled.div`
	padding-top: 25px;

	.section {
		position: relative;
		scroll-margin-top: 4px;
		padding: 60px 0;
	}
	.box-section-wrapper {
		max-width: 1060px;
		width: 87.72%;
		/* width: 1060px; */
		margin: 0 auto;
	}
`;

export default HomePage;
